import React, { Component } from "react";
import styles from './sideBarMenu.css';
// import Glyphicon from 'react-bootstrap/lib/Glyphicon';
import { Nav, NavItem, Navbar, NavDropdown, DropdownItem } from 'react-bootstrap';
import { NavLink } from 'react-router-dom';
import { Form, Button } from 'react-bootstrap';

var MyComponent = React.createClass({
    getInitialState: function () {
      return { input: '' };
    },

    handleChange: function(e) {
      this.setState({ input: e.target.value });
    },

    handleClick: function() {
      console.log(this.state.input);
    },

    render: function() {
      return (
        <div>
          <input type="text" onChange={ this.handleChange } />
          <input
            type="button"
            value="Alert the text input"
            onClick={this.handleClick}
          />
        </div>
      );
    }
  });

class CreateRoomDiv extends Component {


modalRef = React.createRef();

clickAddRoom = () => {
    console.log(this.modalRef)

    this.modalRef.current.setState({modalType: 'NewEventTable'}, () => {

      this.modalRef.current.toggleModal();
  });
    console.log(`you clicked the add event button`);
  };

  render() {
    return (
        <div className="mainDiv" >
            <div className="sideBarMenuContainer">
                <Navbar fluid="true" inverse="true" >
                    <Navbar.Collapse>
                        <Navbar.Text className="nt">
                            <NavLink className="nl" to="/Home">
                                Home
                        </NavLink>
                            <NavLink className="nl" to="/PatientList">
                                PatientList
                        </NavLink>
                            <NavLink className="nl" to="/CreateRoom">
                                CreateRoom
                        </NavLink>
                            <NavLink className="nl" to="/CompanyInfo">
                                Company Info
                        </NavLink>
                            <NavLink className="nl" to="/FrontDesk">
                                Front Desk
                        </NavLink>
                        </Navbar.Text>
                    </Navbar.Collapse>
                </Navbar>
            </div>
            <Form>
  <Form.Group>
    <Form.Label>Room Name</Form.Label>
    <Form.Control type="input" />
  </Form.Group>
  <Form.Group>
    <Form.Label>Organization ID</Form.Label>
    <Form.Control type="input" />
  </Form.Group>
  <Button variant="primary" type="submit"
  onClick={this.clickAddRoom}>
    Create Room
  </Button>
</Form>
<MyComponent />
        </div>


    )
};
}
//exportes our Nav component
export default CreateRoomDiv;
